import React, { Component } from "react";
import axios from 'axios';

class Trainers extends Component {
    constructor(props) {
        super(props);
        this.state={
            trainers: [],
            id: ""
        }
    };

    componentDidMount() {
        this.loadTrainers();
    }

    loadTrainers = () => {
        axios.get('/trainers')
          .then((response) => {
            console.log(response)
            this.setState({trainers: response.data.trainers})
          })
      };

    render() {
        return (
            <div>

            </div>
        )
    }
}
export default Trainers;
